NY RÀN'I JESOA KRISTY TOMPO - Rasamindrakotroka Andry TianaAzo vakiana? NY RÀN'I JESOA KRISTY TOMPO I Jesoa Kristy Tompo, ilay Zanaka tokan'ny Ray ; Tonga teto an-tany mba hamonjy ny mpanota. Nanetry tena, nanaiky, nidina ho nateraka indray, Tao an-tranon'omby iray, izay hita efa tena tonta. I Jesoa Kristy Tompo, nanao fahagagana maro ; Namonjena ireo olona izay hita tena sahirana. Nampisehoana eo imaso ary koa nampahatsiaro, Ny fitiavany tsisy fetra feno tsiky sady mirana. I Jesoa Kristy Tompo,
..........
 fetra nalatsany ny ràny. Ka meteza hiova hadio ho isan'ny nateraka indray ; Ao anatin'ireo zanaka hanaraka an'i Jesoa Tompo, Tsy ny anio ihany na ny ampitso fa koa mandrakizay. Mba tsy very ny ràny raha ny rehetra no manompo. Ny ràn'i Jesoa Kristy, ràn'ny fanantenan'ny tsirairay ; Ny ràn'i Jesoa Tompo, rà miaro amin'ny zava-mahory ; Ny ràn'i Jesoa Kristy, ràn'ny fiainana mandrakizay ; Ny ràn'i Jesoa Tompo, rà sy aina mandemy ny devoly. Ny ràn'i Jesoa Kristy, ràn'ny famelana ny ratsy efa vita ;

Mifankatiava ny velona, fa ny maty tsy mba namana intsony; ny maty momba ny maty, ny velona momba ny velona; ny maty tsy azo antenaina, fa ny velona no azo antenaina. Mifankatiava ny velona, fa ny malemy fanahy tratra amparany; ny mahatsindry fo tian'olona,; fa ny nenina tsy aloha, fa aoriana; koa rizareo no be nenina: raha tezitra manoto fo; ary izahay no tsy mba manenina: raha tezitra mionona ihany; fa ny rariny itompoana dia mody raiben-keloka. Mifankatiava ny velona; fa aza manao roa an-tran
..........
velona: ataovy toy ny vohavoha: malemy tsy tapaka; madilana, tsy maito; ary toy ny rano am-pasika: atao ho ritra, kanjo mbola misy ihany. Mifankatiava ny velona; manaova toy ny tsena; mora hahalalana ny tsy fantatra, ary hahitana ny tsy hita; tsy miantso ka mahavory. Mifankatiava ny velona; ataovy toy ny lamban'akoho: ny makarakara sosohana; faty, hono, no isarahana. Mifankatiava ny velona, fa aza manao fihaonan'omby; ny lehibe manoto ny kely, ny matavy manosika ny mahia. Mifankatiava ny velona;
